prompt --application/shared_components/security/authorizations/isteller
begin
wwv_flow_imp_shared.create_security_scheme(
 p_id=>wwv_flow_imp.id(3902425143328292)
,p_name=>'ISTELLER'
,p_scheme_type=>'NATIVE_FUNCTION_BODY'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'   v_role app_users.role%TYPE;',
'BEGIN',
'   SELECT role INTO v_role',
'   FROM app_users',
'   WHERE username = UPPER(:APP_USER); -- Use UPPER in case usernames are stored lowercase',
'',
'   RETURN v_role = ''TELLER'';',
'EXCEPTION',
'   WHEN NO_DATA_FOUND THEN',
'      RETURN FALSE;',
'END;',
''))
,p_version_scn=>6905970
,p_caching=>'BY_USER_BY_SESSION'
);
end;
